import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './RoomsPage.css';

const RoomsPage = () => {
  const [rooms, setRooms] = useState([]);
  const [newRoom, setNewRoom] = useState({
    category_id: '',
    capacity: '',
    comfort_level: '',
    price: '',
    photo_url: '',
  });
  const [editingRoom, setEditingRoom] = useState(null);

  useEffect(() => {
    fetchRooms();
  }, []);

  const fetchRooms = async () => {
    try {
      const response = await axios.get('http://localhost:5000/rooms');
      setRooms(response.data);
    } catch (error) {
      console.error('Ошибка при загрузке номеров:', error);
    }
  };

  const addRoom = async () => {
    try {
      await axios.post('http://localhost:5000/rooms', newRoom);
      setNewRoom({
        category_id: '',
        capacity: '',
        comfort_level: '',
        price: '',
        photo_url: '',
      });
      fetchRooms();
    } catch (error) {
      console.error('Ошибка при добавлении номера:', error);
    }
  };

  const updateRoom = async (id) => {
    try {
      await axios.put(`http://localhost:5000/rooms/${id}`, editingRoom);
      setEditingRoom(null);
      fetchRooms();
    } catch (error) {
      console.error('Ошибка при обновлении номера:', error);
    }
  };

  const deleteRoom = async (id) => {
    try {
      await axios.delete(`http://localhost:5000/rooms/${id}`);
      fetchRooms();
    } catch (error) {
      console.error('Ошибка при удалении номера:', error);
    }
  };

  return (
    <div className="rooms-container">
      <h1>Список номеров</h1>
      <div className="rooms-grid">
        {rooms.map((room) => (
          <div className="room-card" key={room.id}>
            <img src={`http://localhost:5000/${room.photo_url}`} alt={room.comfort_level} />
            <h3>{room.comfort_level}</h3>
            <p>Категория: {room.category_name}</p>
            <p>Вместимость: {room.capacity} человек</p>
            <p>Цена: {room.price} руб./ночь</p>
            <div className="card-actions">
              <button onClick={() => setEditingRoom(room)}>Редактировать</button>
              <button onClick={() => deleteRoom(room.id)}>Удалить</button>
            </div>
          </div>
        ))}
      </div>

      <div className="add-room">
        <h2>Добавить номер</h2>
        <input
          type="text"
          placeholder="ID категории"
          value={newRoom.category_id}
          onChange={(e) => setNewRoom({ ...newRoom, category_id: e.target.value })}
        />
        <input
          type="text"
          placeholder="Вместимость"
          value={newRoom.capacity}
          onChange={(e) => setNewRoom({ ...newRoom, capacity: e.target.value })}
        />
        <input
          type="text"
          placeholder="Уровень комфорта"
          value={newRoom.comfort_level}
          onChange={(e) => setNewRoom({ ...newRoom, comfort_level: e.target.value })}
        />
        <input
          type="text"
          placeholder="Цена"
          value={newRoom.price}
          onChange={(e) => setNewRoom({ ...newRoom, price: e.target.value })}
        />
        <input
          type="text"
          placeholder="Ссылка на фото"
          value={newRoom.photo_url}
          onChange={(e) => setNewRoom({ ...newRoom, photo_url: e.target.value })}
        />
        <button onClick={addRoom}>Добавить</button>
      </div>
    </div>
  );
};

export default RoomsPage;
